import React from 'react'

const SignupTopBar = () => {
  return (
    <div className='flex flex-row justify-between items-center mx-8 sticky top-0'>
        <div>
          <img src={require('../images/logo.png')} className="h-20 mr-3" alt="Leader Logo"/>
        </div>
    </div>
  )
}

export default SignupTopBar
